import React from "react";
import Header from "../common/Header";
import ann from "./images/ann.png"

const HomePage = () => {
  return (
    <>
      <Header pageTitle={"Home Page"} />
      <div className="mx-0 mt-4 p-4 bg-gray-100 border-b border-gray-600 justify-between">
        <h2 className="text-xl font-bold mb-2">Announcement</h2>
        <p></p>
      </div>
      <div class="notification-section bg-gray-100 p-4 rounded-md shadow-md">
        <div class="flex justify-between items-center">
          <h3 class="text-lg font-medium text-gray-800 ml-10">Announcement Section</h3>
            <button class="btn-primary">ADD NEW ANNOUNCEMENT</button>
        </div>
        <div class="pt-10 ml-32">
          <div className="inline-flex">
          <img className="w-12 " src={ann}/>
            <h3 class="text-lg font-medium text-gray-800">Create Announcement</h3>
            <p class="text-gray-600 mt-7">Notify all students of your announcement</p>
        </div>
          </div>
      </div>
    </>
  );
};

export default HomePage;
